import Footer from './components/footer/Footer';


/* eslint-disable react/jsx-no-undef */
function App() {

  return (
    <div className="App">
    <TopBar />
    <Routes>
    <Route exact path="/" element={<Home />} />
    <Route exact path="/projects" element={<Projects />} />
    </Routes>
    <Footer />
    </div>
  );
}

export default App;
